import Astrologie_Fev2023 from "../articles/astrologie-fevrier-2023.pdf"

function pdfFinder(id){
    const articleMapper = [{
        title: ":L'astrologie: un outil de découverte de soi.",
        id: "astrologie_outil_decouverte_de_soi",
        file: {Astrologie_Fev2023},
        edition: "FEV_23"
    }]
    const index = articleMapper.findIndex(object => {
        return object.id === id;
    });
    return articleMapper[index].file
}

export default pdfFinder()
